@R_A_Ziemkiewicz @BeataMonka @kawecki_maciej Może nie lepiej, ale boleśniej.
Dzisiejszy świat, staje się "rzeczywistością" opisaną przez Lema w "Kongresie futurologicznym". 
Lem jeszcze uważał, że do fałszowania rzeczywistości są potrzebne specjalne środki chemiczne odziaływujące na CUN. Dziś wiemy, że wystarczą media.

@gromotapl Frekwencja pociesza. 
Stanisław Lem: &gt;... przewidywać przyszłość można najłatwiej, kiedy się uznaje, że zajdzie to, co uchodzi aktualnie za całkowitą niemożliwość, za "sen wariata śniony nieprzytomnie", za nieziszczalne rojenie.&lt;
Czy kiedyś media społecznościowe zostaną zakazane?

Anders Szkoła Polska i Stanisław Lem "Wczoraj, dzisiaj, jutro" - Wystawa wirtualna:
https://t.co/5gnZ7KpiZ7
@plorit

@Najwazniejsze Lem widzial postempy w medycynie? 
Ja zyje juz 70 lat i ani deczka postepu nie zauwazylem. Ciagle nie nie potrafi wleczyc z zadanej absolutnir choroby, czy uzaleznienia, Jedyny postep, to coraz wyzsze ceny. 
Po cenach do nieba!

